import React,{useState,useContext} from 'react';
import './signIn.css';
// import { SignUpContext } from '../../contexts/SignUpContext';

function SignIn({email,pass}) {
    
  
    

    const signIn = (e)=> {
        e.preventDefault();
        console.log(
            "The email :",email,
            "the Pass : ",pass
            
        )

    }
    return (
        <div className='form_container'>
         <form>
            <h3>Sign In</h3>
             <div className="email">
                 <h4>Email</h4>
                 <input type="email" placeholder='email..'
                     value={email}
                     onChange={(e)}
                 />
             </div>
             <div className="pass">
                <h4>Password</h4>
                 <input type="password" placeholder='Password'
                 value={pass}
                     
                 />
             </div>
             <button 
                type="submit"
                onClick={signIn}>
                Sign in</button>
         </form>
            
        </div>
    )
}

export default SignIn
